const HomePage = ({Image_One, Image_Two, Image_Three, name, title}) =>(
        <div>
            <img src={Image_One}  alt = {Image_One}/>
            <img src={Image_Two}  alt = {Image_Two}/>
            <img src={Image_Three}  alt = {Image_Three}/>
            <h4> {name}</h4>
            <p>{title}</p>
        </div>
    );

export default HomePage;
